import React, { Component } from 'react';


class Home extends Component {
  render() {
    return (
      <div>
        <div style={{backgroundColor: '#a8c4c4', height: '70vh', width: '100%', display: 'flex', textAlign: 'center'}}>
          <img style={{width: 300}} src={process.env.PUBLIC_URL + '/logo.png'} alt="banner" />
          <h1>Title</h1>
        </div>
      </div>
    );
  }
}

export default Home;
